import { Typography } from '@mui/material'
import React, { useState } from 'react'
import { useEffect } from 'react'

function ApiTest() {
   const [data,setData]= useState([])

   useEffect(()=>{fetch('https://tomestry.com/api/merchandise/').then((res)=>{return res.json()}).then((res)=>{return res.map((e)=>{return setData(e)})})})


  return (
    <div>{data.map((el)=>{return <Typography>{el.vendor}</Typography>})}</div>
  )
}

export default ApiTest
